import styled from "styled-components";

const HeaderContainer = styled.div`
   position: relative;
   height: 800px;
   min-height: 500px;
   width: 100%;
   background: #161415 url("/portfolio/images/mountain.jpeg") no-repeat top center;
   /* background-image: url("./landscape.jpg"); */
   background-size: cover !important;
   -webkit-background-size: cover !important;
   text-align: center;
   overflow: hidden;
`;

const Overlay = styled.div`
   height: 800px;
   min-height: 500px;
   width: 100%;
   background: rgba(0,0,0,0.3);
`;


const Header = () => {

    return(
        <HeaderContainer>
            <Overlay>
                <Navbar />
            </Overlay>
        </HeaderContainer>
    )
}

export default Header;
